  state = {
    name: 'Tudor',
    age: 27
  }
  render() {
    return (
      <div className="App" >

        <img src={MYtineraryLogo} alt="ItineraryLogo" />
        <img src={circledRightarrow} alt="RightArrow" />
      </div >
    );
  }
}
export default App
